import classes from './Form.module.css';
import FormBtn from '../Buttons/FormButtons/FormBtn';

const Form = () => {
  return (
    <form className={classes.Form} action="#">
        <input className={classes.FormInput} name='email' required placeholder='Ваш E-mail' type="email" />
        <input className={classes.FormInput} name='password' required placeholder='Ваш пароль' type="password" />
        <FormBtn/>
    </form>
  ) 
}

export default Form;
